window.addEventListener("load",(()=>{const a=new URL(window.location.href),n=new URLSearchParams({path:a.pathname,t:Date.now().toString(),r:Math.random().toString()});navigator.sendBeacon(`/api/analytics/access?t=${(new Date).getTime()}`,n)})),window.addEventListener("beforeunload",(()=>{const a=new URL(window.location.href),n=new URLSearchParams({path:a.pathname,t:Date.now().toString(),r:Math.random().toString()});navigator.sendBeacon(`/api/analytics/unload?t=${(new Date).getTime()}`,n)}));